import "./ExpenseForm.css";
import { useState } from "react";

function ExpenseForm() {
  const [enteredtTitle, setEnteredTitle]=useState('');
  const [enteredtAmount, setEnteredAmount]=useState('');
  const [enteredtDate, setEnteredDate]=useState('');
  function titleChangeHandler(event){
    setEnteredTitle(event.target.title);
  }
  function amountChangeHandler(event){
    setEnteredAmount(event.target.title);
  } 
  function dateChangeHandler(event){  
    setEnteredDate(event.target.title);
  }       
  function submitHandler(event){
    event.preventDefault();

    const expenseData = {
      title: enteredtTitle,
      amount: enteredtAmount,
      date: new Date(enteredtDate)
    }

    console.log(expenseData);
  }            
  return (
    <form onSubmit={submitHandler}>
      <div className="new-expense__controls">
        <div className="new-expense__control">
          <label>Title</label>
          <input type="text" onClick={titleChangeHandler}></input>  
        </div>
        <div className="new-expense__control">
          <label>Amount</label>
          <input type="number" min='0.01' step='0.01' onClick={amountChangeHandler}/>  
        </div>
        <div className="new-expense__control">
          <label>Date</label>
          <input type="date" min='2023-01-01' max='2030-01-01' onClick={dateChangeHandler}/>  
        </div>
      </div>
      <div className="new-expense__actions">
        <button type="submit">Add Expense</button>
      </div>
    </form>
  );
}

export default ExpenseForm;
